SELECT SUM(generico_5.inversionus) AS temptc_26225288700,   CAST(EXTRACT(MONTH FROM generico_5.fecha) AS LONG) AS mnfechaok,   SUM(generico_5.inversionus) AS sumcalculation_0061002123102817ok,   CAST(EXTRACT(YEAR FROM generico_5.fecha) AS LONG) AS yrfechaok FROM generico_5 WHERE ((CAST(EXTRACT(YEAR FROM generico_5.fecha) AS LONG) >= 2010) AND (CAST(EXTRACT(YEAR FROM generico_5.fecha) AS LONG) <= 2015) AND (((CAST(EXTRACT(MONTH FROM generico_5.fecha) AS LONG) >= 1) AND (CAST(EXTRACT(MONTH FROM generico_5.fecha) AS LONG) <= 7)) OR (CAST(EXTRACT(MONTH FROM generico_5.fecha) AS LONG) IS NULL)) AND (generico_5.anunciante IN ('BANTRAB/TODOTICKET', 'TODOTICKET', 'TODOTICKET.COM'))) GROUP BY mnfechaok,   yrfechaok;
